&quot;Behold, I come quickly: blessed is he that keepeth the sayings of the prophecy of this book&quot; ( REVELATION 22:7). What book is that? And what is this &quot;Behold&quot; business? Gain understanding as we read through the Bible, learning what we can of God's perspective and author-ity over time. Be one to take on the readiness of the Lord's coming.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
